// src/pages/AdminDashboard.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AdminDashboard = () => {
    const [availableSeats, setAvailableSeats] = useState(0);
    const [bookedSeats, setBookedSeats] = useState(0);

    useEffect(() => {
        // Replace with your API endpoint or logic to fetch seat data
        axios.get('/api/seats')
            .then(response => {
                const { available, booked } = response.data;
                setAvailableSeats(available);
                setBookedSeats(booked);
            })
            .catch(error => {
                console.error('There was an error fetching the seat data!', error);
            });
    }, []);

    return (
        <div className="container mt-5">
            <h1 className="mb-4">Admin Dashboard</h1>
            <div className="row">
                <div className="col-md-6 mb-4">
                    <div className="card">
                        <div className="card-body text-center">
                            <h5 className="card-title">Available Seats</h5>
                            <p className="card-text display-4">{availableSeats}</p>
                        </div>
                    </div>
                </div>
                <div className="col-md-6 mb-4">
                    <div className="card">
                        <div className="card-body text-center">
                            <h5 className="card-title">Booked Seats</h5>
                            <p className="card-text display-4">{bookedSeats}</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default AdminDashboard;
